import logo from './logo.svg';
import './App.css';
import TailwindTest from "./TailwindTest";
import { Accordion, AccordionItem, AccordionTrigger, AccordionContent } from "./components/Accordion";

function App() {
  return (
    <div>
      <TailwindTest />
      <div className="max-w-md mx-auto mt-10">
        <Accordion>
          <AccordionItem value="item-1">
            <AccordionTrigger>What is ShadCN UI?</AccordionTrigger>
            <AccordionContent>
              ShadCN UI is a collection of beautifully designed components built on top of Radix UI and Tailwind CSS.
            </AccordionContent>
          </AccordionItem>
          <AccordionItem value="item-2">
            <AccordionTrigger>Is Tailwind CSS working?</AccordionTrigger>
            <AccordionContent>
              Yes! If you see this accordion styled and animated, Tailwind CSS is working in your project.
            </AccordionContent>
          </AccordionItem>
        </Accordion>
      </div>
    </div>
  );
}

export default App;
